import React from 'react';
import './App.css';
import Header from './Components/Header.js';
import NavigationBar from './Components/NavigationBar.js'
import ExecutiveBoard from './Components/Tabs/About/ExecutiveBoard';

function App() {
  return (
    <div>
      <Router>
        <NavBar />

        <Route
          path="/"
          exact
          render={() => 
          <div></div>}
        />

        <Route
          path="/about"
          exact
          render={() => 
          <ExecutiveBoard></ExecutiveBoard>}
        />

        <Route
          path="/profile"
          exact
          render={() => 
          <div></div>}
        />

      </Router>
    </div>
  );
}

export default App;
